import React from 'react';
import { Text } from '@react-three/drei';
import { FontLoader } from 'three/src/loaders/FontLoader';
import ethnocentricFont from '../assets/fonts/ethnocentric.otf';

const Logo = () => {
  const font = new FontLoader().parse(ethnocentricFont);

  return (
    <>
      <Text
        color="white"
        fontSize={0.5}
        font={font}
        position={[0, 0, -2]}
        anchorX="center"
        anchorY="middle"
      >
        <meshStandardMaterial attach="material" color="white" />
        <textGeometry attach="geometry" args={['Diving', { font, size: 0.5, height: 0.1 }]} />
      </Text>

      <Text
        color="blue"
        fontSize={0.5}
        font={font}
        position={[0.7, 0, -2]}
        anchorX="center"
        anchorY="middle"
      >
        <meshStandardMaterial attach="material" color="blue" />
        <textGeometry attach="geometry" args={['ES', { font, size: 0.5, height: 0.1 }]} />
      </Text>
    </>
  );
};

export default Logo;
